import React, {Component} from "react";
import memberInfo from "../Teams/memberInfo";

class LastWork extends Component {
    constructor() {
        super()
        const memberMore = []
        this.state = { memberInfo : memberInfo }
        this.clickMore = this.clickMore.bind(this);
    }
    
    clickMore() {
        memberInfo.map(member => <TeamMember
                                    id = {member.id}
                                    img = {member.img}
                                    name = {member.name}
                                    position = {member.position}
                                    phone = {member.phone}
                                    email = {member.email}
                                    website = {member.website}
                                 />
        );
        this.memberMore.push( memberInfo[0] );
        return(memberMore);
    }    

    render() {
        return(
            <div>
                <button className="container bg-black text-white rounded" onClick={this.clickMore}>
                    More Of Our Team
                </button>
                <div>{this.clickMore(this.state.memberInfo)}</div>
                {/* <div> {this.memberMore} </div> */}
            </div>
        )
    }
}

export default LastWork;
